const icon_menu = document.querySelector('.icons-menu');
const menu_links = document.querySelectorAll(".menu__link");
const menu = document.querySelector('.menu__list');
const portfolio_link = document.querySelectorAll(".portfolio__link");
const masonry_item = document.querySelectorAll(".portfolio-masonry__item");



icon_menu.addEventListener("click", function (e) {
    this.classList.toggle("menu__icon--open");
    menu.classList.toggle("menu__list--open")
});
menu_links.forEach((e) => {
    e.addEventListener("click", function (event) {
        const sec_menu = e.parentElement.querySelector(".sec");
        console.log(sec_menu);
        if (sec_menu) {
            // e.preventDefault();
            console.log("hello");
            event.preventDefault();
            sec_menu.classList.toggle("sec--open");
        }
    });
});


$(document).ready(function () {
    $('.hero-slider').slick({
        arrows: false,
        dots: false,
        autoplay: true,
        infinite: true,
        fade: true,
        speed: 500,
        cssEase: 'linear'
    });
    if ($(".animsition").length) {
        $(".animsition").animsition({
            inClass: 'fade-in-up-sm',
            outClass: 'fade-out-up-sm',
            inDuration: 1100,
            outDuration: 800,
            linkElement: '.animsition-link',
            loading: true,
            loadingParentElement: 'body',
            unSupportCss: ['animation-duration',
                '-webkit-animation-duration',
                '-o-animation-duration'
            ],
            overlay: false,
            overlayClass: 'animsition-overlay-slie',
            overlayParentElement: 'body'
        });
    }
    $('.portfolio-masonry').isotope({
        itemSelector: '.portfolio-masonry__item',
    });

    $('.company-slider').slick({
        arrows: false,
        dots: true,
        autoplay: true,
        infinite: true,
        fade: true,
        speed: 500,
        cssEase: 'linear'
    });
});



portfolio_link.forEach((elem) => {
    elem.addEventListener("click", function (event) {
        event.preventDefault();
        document.querySelector(".portfolio__link--active").classList.remove("portfolio__link--active");
        this.classList.add("portfolio__link--active");
        var category = this.getAttribute("data-filter");
        $('.portfolio-masonry').isotope({ filter: category });
    });
});



const aside_posts_link = document.querySelectorAll(".aside-posts__link");
const aside_posts_list_span = document.querySelector(".aside-posts__list span");

aside_posts_list_span.style.width = document.querySelector(".aside-posts__link.activ").offsetWidth + "px";

aside_posts_link.forEach((element1) => {
    element1.addEventListener("click", function (event) {
        event.preventDefault();
        const aside_posts_link_activ = document.querySelector(".aside-posts__link.activ");
        aside_posts_link_activ.classList.remove("activ");
        element1.classList.add("activ");
        aside_posts_list_span.style.width = element1.offsetWidth + "px";
        aside_posts_list_span.style.left = element1.offsetLeft + "px";
        // console.log(element.offsetLeft);
        const category = element1.getAttribute("category");
        const aside_posts_posts = document.querySelectorAll(".aside-posts__posts");
        aside_posts_posts.forEach((element2) => {
            if (element2.classList.contains(category)) {
                element2.classList.add('aside-posts__posts-active')
            } else {
                element2.classList.remove('aside-posts__posts-active')
            }
        });

    });

});



wow = new WOW(
    {
        boxClass: 'wow',      // default
        animateClass: 'animated', // default
        offset: 0,          // default
        mobile: true,       // default
        live: true        // default
    })
wow.init();








